import { useEffect } from "react";
import styles from "./StatPage.module.css";
import { fetchStatPC, fetchStatStore } from "../../utils/api";

export const StatPage = () => {
    const from = "2019-08-24T14:15:22Z";
    const until = "2024-08-24T14:15:22Z";

    const getStatPC = () => {
        fetchStatPC(from, until)
            .then(res => {
                console.log({ res });
                // dispatch({ type: FETCH_COMPUTERS_SUCCESS, payload: res });
            })
            .catch(error => {
                console.log({ error });
                // dispatch({ type: FETCH_COMPUTERS_FAILURE, payload: error });
            });
    }
    const getStatStore = () => {
        fetchStatStore(from, until)
            .then(res => {
                console.log({ res });
                // dispatch({ type: FETCH_COMPUTERS_SUCCESS, payload: res });
            })
            .catch(error => {
                console.log({ error });
                // dispatch({ type: FETCH_COMPUTERS_FAILURE, payload: error });
            });
    }
    return (
        <section className={styles.container}>
            <h1>Статистика</h1>
            {/* графики */}
            <article>
                {/* <p>Какие-то графики</p> */}
                <button>
                    fetchStatPC
                </button>
            </article>
        </section>
    )
};
